import './About.css';
import React from 'react';
import {Link} from "react-router-dom";

function About() {
  return (
    <div className='About-background'>
      <header className='About-header'>
        <h1 className='Title'>about me</h1>
        <Link to="/">
          <button className="About-links">
            mainpage
          </button>
        </Link>     
      </header>
    </div>
  );
}

export default About;
